  dots: false,
  arrows: false,
  infinite: true,
  speed: 3000, // Duration of the transition (in ms)
  slidesToShow: 9, // Default for large screens
  slidesToScroll: 1,
  autoplay: true,
  autoplaySpeed: 0, // Continuous scrolling
  cssEase: 'linear', // Smooth linear transition
  pauseOnHover: false,
